export const styles = theme => ({
    text: {
        display: "block",
        marginBottom: theme.spacing(3),
    },
    highlight: {
        color: theme.palette.primary.main,
    },
    inputContainer: {
        display: "flex",
        justifyContent: "space-between",
        marginTop: theme.spacing(3),
    },
    input: {
        width: `calc(50% - ${theme.spacing(1)}px)`,
    },
});
